import React from 'react';

class HomePage extends React.Component {
    render() {
      return <header className='HomePage'>
        <h1>Баланс</h1>
        <p id='balance'>0,00$</p>

        <div className='buttomTrans'>
            <div id='send'></div>
            <div id='get'></div>
            <div id='Exchange'></div>
            <div id='P2P'></div>
        </div>

        </header>;
    }
}

export default HomePage
